%[text] %[text:anchor:T_3EF385E6] # **Settlement Chart Examples**
%[text] %[text:anchor:H_8D0530DB] **Overview**
%[text] The `SettlementChart` displays the option prices against strike price. The option prices comprise put prices below the at-the-money (ATM) price, and call prices above the ATM price. The ATM price, i.e., where the call and put prices are equal, is highlighted by the call-put parity line. 
%[text] The chart data are:
%[text] - `Price`, $S${"editStyle":"visual"}: the current price of the underlying asset.
%[text] - `Strike`, $K${"editStyle":"visual"}: the strike (i.e., exercise) price of the option, expressed as an increasing vector.
%[text] - `Rate`, $r${"editStyle":"visual"}: the annualized continuously compounded risk-free rate of return over the life of the option, expressed as a positive decimal number.
%[text] - `Time`, $T${"editStyle":"visual"}: the time to expiry of the option, expressed in years.
%[text] - `Volatility`, $\\sigma${"editStyle":"visual"}: the annualized asset price volatility (i.e., the annualized standard deviation of the continuously compounded asset return), expressed as a positive decimal number.
%[text] - `Yield`**, **$q${"editStyle":"visual"}: the annualized continuously compounded yield of the underlying asset over the life of the option, expressed as a decimal number.  \
%[text] These inputs are then used to compute the values of the *European put and call option prices* using the Black-Scholes model, given by the following equations:
%[text]{"align":"center"} $C = S \\cdot\\Phi{ \\left( d\_1 \\right) } - K e^{ -(r + q) T }  \\Phi{ \\left( d\_2 \\right) } \\\\\nP = K e^{-( r + q) T }  \\Phi{ \\left( - d\_2 \\right) } - S \\cdot \\Phi{ \\left( - d\_1 \\right) }$
%[text] where $\\Phi${"editStyle":"visual"} is the cumulative distribution function for the standard normal distribution ([**`normcdf`**](<matlab: doc( "normcdf" )>)) and:
%[text]{"align":"center"} $d\_1 = \\frac{ \\log{ \\left( \\frac{ S }{ K } \\right) } + \\left( r + \\frac{ \\sigma^2 }{ 2 } \\right) T }{ \\sigma \\sqrt{ T } }, \\quad\nd\_2 = d\_1 - \\sigma \\sqrt{ T }.$
%[text] Note that any of the inputs listed above can be omitted. This will result in the use of default values, which are defined as:
%[text] - *Strike*: 85 to 115 with spacing of 1
%[text] - *Underlying asset price*: 100
%[text] - *Rate*: 0.05
%[text] - *Time*: 0.25 years
%[text] - *Volatility*: 0.5
%[text] - *Yield*: 0 \
%[text] ![SettlementChart.png](text:image:55c7)
%[text] %[text:anchor:H_0F68E975] **Documentation**
%[text] - [`blsprice`](<matlab: doc( "blsprice" )>): Black-Scholes call and put option pricing
%[text] - [`normcdf`](<matlab: doc( "normcdf" )>): Normal cumulative distribution function \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_C5982AE5] ## Define input data for the chart.
%[text] Strike prices, defined in currency units, e.g., $US.
Strike = (85:0.1:115).';
%[text] The price of the underlying asset, defined in currency units.
Price = 100;
%[text] Risk-free interest rate, expressed as a decimal number between 0 and 1.
Rate = 0.04;
%[text] Time to expiry, expressed in years.
Time = 0.25;
%[text] Volatility, expressed as a decimal number between 0 and 1.
Volatility = 0.45;
%[text] Dividend yield, expressed as a decimal number between 0 and 1.
Yield = 0.01;
%%
%[text] %[text:anchor:H_35CA46AA] ## Create a figure for the chart.
f = exampleFigure( "Name", "SettlementChart Example" );
%%
%[text] %[text:anchor:H_93528637] ## Create the chart.
SC = SettlementChart( "Parent", f, ... %[output:group:9a1b1ab1] %[output:2170b873]
    "Strike", Strike, ... %[output:2170b873]
    "Price", Price, ... %[output:2170b873]
    "Rate", Rate, ... %[output:2170b873]
    "Time", Time, ... %[output:2170b873]
    "Volatility", Volatility, ... %[output:2170b873]
    "Yield", Yield ); %[output:group:9a1b1ab1] %[output:2170b873]
%%
%[text] %[text:anchor:H_B60424ED] ## Access the option prices from the chart.
%[text] The corresponding call and put option prices are computed by the chart using the Black-Scholes model. We can access these using the `OptionPrices` chart property. This is a 2-column matrix containing the call and put prices in its columns, respectively.
CallPrices = SC.OptionPrices(:, 1);
PutPrices  = SC.OptionPrices(:, 2);
%[text] The *at-the-money price*, where the call and put prices intersect, is also computed by the chart. We can query the chart property `AtTheMoneyPrice` to retrieve this. It is also displayed in the label of the constant line plotted on the chart's axes.
disp( "At-the-money price: " + num2str( SC.AtTheMoneyPrice, "%.2f" ) ) %[output:656f17ab]
%%
%[text] %[text:anchor:H_184E93F5] ## Adjust the chart data.
%[text] We can adjust any of the chart's data properties, including after the chart has been created.
%[text] For instance, we can change the underlying asset price.
SC.Price = 99.5; %[output:1cf0a616]
%[text] Multiple properties can be adjusted using the [set](<matlab: doc( "set" )>) command.
set( SC, "Volatility", 0.75, "Yield", 0.05 ) %[output:1cf0a616]
%[text] The chart's graphics and controls update automatically.
%[text] Display the new at-the-money price.
disp( "At-the-money price: " + num2str( SC.AtTheMoneyPrice, "%.2f" ) ) %[output:06b9a463]
%%
%[text] %[text:anchor:H_F4CEB795] ## Customize the chart appearance.
%[text] We can customize the chart appearance to meet our requirements. For instance, we can update the chart's annotations.
xlabel( SC, "Strike price ($)", "FontSize", 14 ) %[output:337d733f]
ylabel( SC, "Option price ($)", "FontSize", 14 ) %[output:337d733f]
title( SC, "Settlement Chart", "FontSize", 16 ) %[output:337d733f]
%[text] We can also adapt various decorative properties of the lines.
set( SC, "CallLineWidth", 1.5, ... %[output:group:7090ca46] %[output:337d733f]
    "PutLineWidth", 1.5, ... %[output:337d733f]
    "AtTheMoneyColor", [0.25, 0.25, 0.25], ... %[output:337d733f]
    "AtTheMoneyLineWidth", 1.5, ... %[output:337d733f]
    "AtTheMoneyLineStyle", ":" ) %[output:group:7090ca46] %[output:337d733f]
%%
%[text] %[text:anchor:H_31E39805] ## Chart interactivity.
%[text] We can hide or show the chart's control panel via the `Controls` property.
SC.Controls = "off"; %[output:1697fd45]
%%
%[text] %[text:anchor:H_AF696DAD] ## Reset the chart.
%[text] The control panel includes a button for restoring the default chart data. Programmatically, this is equivalent to invoking the chart's `reset` method.
reset( SC ) %[output:285bdbbd]
